import React, { useState, useEffect } from "react";
import { useTable, useSortBy, useGlobalFilter } from "react-table";
import csvData from "./bestPitches.csv";

const GlobalFilter = ({ filter, setFilter }) => {
  return (
    <input
      value={filter || ""}
      onChange={(e) => setFilter(e.target.value || undefined)}
      placeholder={"Search..."}
    />
  );
};

export const Results = () => {
  const [playerData, setPlayerData] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      const response = await fetch(csvData);
      const data = await response.text();
      let parsedData = data.split("\n").map((row) => row.split(","));
      while (parsedData.length > 0 && parsedData[parsedData.length - 1].every((cell) => !cell)) {
        parsedData.pop();
      }
      const headers = parsedData.shift();
      const players = parsedData.map((row) =>
        headers.reduce((obj, header, index) => {
          obj[header] = row[index];
          return obj;
        }, {})
      );
      setPlayerData(players);
    };
    fetchData();
  }, []);

  const columns = React.useMemo(
    () => [
      { Header: "Player Name", accessor: "player_name" },
      { Header: "Pitch Type", accessor: "pitch_type" },
      { Header: "Stuff Grade", accessor: "stuffGrade" },
      { Header: "nPitches", accessor: "nPitches" },
    ],
    []
  );

  const {
    getTableProps,
    getTableBodyProps,
    headerGroups,
    rows,
    prepareRow,
    state,
    setGlobalFilter,
  } = useTable({ columns, data: playerData }, useGlobalFilter, useSortBy);

  const { globalFilter } = state;

  return (
    <div>
      <GlobalFilter filter={globalFilter} setFilter={setGlobalFilter} />
      <table {...getTableProps()} style={{ fontSize: "1rem", borderCollapse: "collapse", margin: "auto" }}>
        <thead>
          {headerGroups.map((headerGroup) => (
            <tr {...headerGroup.getHeaderGroupProps()}>
              {headerGroup.headers.map((column) => (
                <th
                  {...column.getHeaderProps(column.getSortByToggleProps())}
                  style={{ border: "1px solid black", padding: "10px" }}
                >
                  {column.render("Header")}
                  <span>{column.isSorted ? (column.isSortedDesc ? " ðŸ”½" : " ðŸ”¼") : ""}</span>
                </th>
              ))}
            </tr>
          ))}
        </thead>
        <tbody {...getTableBodyProps()}>
          {rows.map((row) => {
            prepareRow(row);
            return (
              <tr {...row.getRowProps()} style={{ border: "1px solid black" }}>
                {row.cells.map((cell) => {
                  return (
                    <td {...cell.getCellProps()} style={{ border: "1px solid black", padding: "10px" }}>
                      {cell.render("Cell")}
                    </td>
                  );
                })}
              </tr>
            );
          })}
        </tbody>
      </table>
    </div>
  );
};
